    public static int removePairs(List<String> chars ){
        int removed = 0;
        for(int i = 0; i < chars.size() -1 ; i++) {
            var left = chars.get(i);
            var right = chars.get(i+1);
            if(left.equalsIgnoreCase(right) && !left.equals(right)){
                removed += 2;

                chars.remove(i+1);
                chars.remove(i);
            }
        }
        if(removed > 0 ) {
            return removePairs(chars);
        }
        return chars.size();
    }

